export const enum CABINET_STATUS {
  USED = 2,
  UNUSED = 1,
  DAMAGE = 3,
  REPAIR = 4
}
export const enum CABINET_STATUS_TIP {
  USED = '占用中',
  UNUSED = '空闲',
  DAMAGE = '已损坏',
  REPAIR = '维修中'
}
